import { useState } from 'react';

function App() {
  const [todo, setTodo] = useState('');
  const onChangeHandler = (e) => setTodo(e.target.value);
  const onSubmit = (e) => {
    e.preventDefault();
    console.log(e.preventDefault());
  };

  return (
    <div>
      <form onSubmit={onSubmit}>
        <input value={todo} onChange={onChangeHandler} />
        <button>작성</button>
      </form>
    </div>
  );
}

export default App;
